import React from 'react';

function Article(){
  const body = <section>body</section>
	return(
    	<div className="title">
       		<h1>title</h1>
          	{body}
        	<h3>creation date: {(new Date).toDateString()}</h3>
        </div>
    )
}

export default Article;
